import React from 'react';
import collegeLogo from './assets/CollegeLogo.png'; // Ensure the path is correct

export default function Login() {
    return (
        <div style={styles.loginBackground}>
            <div style={styles.loginPanel}>
                <img src={collegeLogo} alt="college logo" style={styles.collegeLogo} />
                <h2 style={styles.title}>SRI SHAKTHI</h2>
                <h3 style={styles.subtitle}>
                    INSTITUTE OF ENGINEERING AND TECHNOLOGY
                    <br />
                    AN AUTONOMOUS INSTITUTION
                </h3>
                <p style={styles.controllerText}>OFFICE OF CONTROLLER OF EXAMINATION</p>

                <div style={styles.inputContainer}>
                    <label style={styles.label}>Enter Register No</label>
                    <input type="text" style={styles.input} placeholder="714021104033" />
                </div>

                <div style={styles.inputContainer}>
                    <label style={styles.label}>Date Of Birth</label>
                    <input type="text" style={styles.input} placeholder="16/05/2033" />
                </div>

                <button style={styles.button}>Get Result</button>
            </div>
        </div>
    );
}

const styles = {
    loginBackground: {
        backgroundColor: '#FFD700',
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    loginPanel: {
        backgroundColor: '#fff',
        borderRadius: '20px',
        padding: '20px',
        width: '300px',
        textAlign: 'center',
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    },
    collegeLogo: {
        width: '80px',
        marginBottom: '10px',
    },
    title: {
        fontSize: '22px',
        fontWeight: 'bold',
        color: '#0C9E36',
        margin: '5px 0',
    },
    subtitle: {
        fontSize: '12px',
        color: '#0C9E36',
        margin: '5px 0',
        lineHeight: '1.2',
    },
    controllerText: {
        fontSize: '10px',
        color: '#000',
        marginBottom: '20px',
    },
    inputContainer: {
        marginBottom: '15px',
        textAlign: 'left',
    },
    label: {
        fontSize: '12px',
        color: '#0C9E36',
    },
    input: {
        width: '100%',
        padding: '8px',
        marginTop: '5px',
        borderRadius: '20px',
        border: '2px solid #0C9E36',
        outline: 'none',
        textAlign: 'center',
        fontSize: '14px',
    },
    button: {
        backgroundColor: '#008000',
        color: '#fff',
        border: 'none',
        borderRadius: '20px',
        padding: '10px 20px',
        cursor: 'pointer',
        width: '100%',
        fontSize: '16px',
    },
};
